import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

// Kiểm tra xem phần tử có tồn tại hay không và thêm kiểu cho `root`
const rootElement = document.getElementById('root');
if (rootElement) {
  const root = ReactDOM.createRoot(rootElement);
  root.render(
    <React.StrictMode>
      <App />
    </React.StrictMode>
  );
}

// Nếu bạn muốn đo hiệu suất trong ứng dụng của mình, bạn có thể sử dụng reportWebVitals
reportWebVitals();
